<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>3x3 Grid with Photos</title>
    <style>
        /* Container to hold the entire layout */
        .container {
            width: 600px;       /* Set the width of the container */
            height: 600px;      /* Set the height of the container */
            margin: 0 auto;     /* Center the container horizontally */
            display: block;     /* Block-level container */
        }

        /* Each row will take up 1/3 of the container height */
        .row {
            width: 100%;        /* Full width of the container */
            height: 33.33%;     /* Divide the height into 3 equal parts */
            display: block;     /* Block-level rows */
        }

        /* Cells within a row, each taking up 1/3 of the width */
        .cell {
            width: 33.33%;      /* Each cell takes up 1/3 of the row width */
            height: 100%;       /* Cells take up the full height of the row */
            float: left;        /* Cells align side-by-side */
            box-sizing: border-box; /* Ensure borders are included in width/height */
            border: 1px solid #ccc; /* Optional: Border around each cell */
        }

        /* Styling for images inside the cells */
        .cell img {
            width: 100%;        /* Make the image fill the cell's width */
            height: 100%;       /* Make the image fill the cell's height */
            object-fit: cover;  /* Ensure images fill the cell without distortion */
        }
    </style>
</head>
